// FindOneCacheByAppID 根据appID查询一条数据并设置缓存
func (o *OfficialaccountRepo) FindOneCacheByAppID(ctx context.Context, appID string) (*fkratos_wechat_model.Officialaccount, error) {
	resp := new(fkratos_wechat_model.Officialaccount)
	cacheKey := o.cache.Key(cacheOfficialaccountByAppIDPrefix, appID)
	cacheValue, err := o.cache.Fetch(ctx, cacheKey, func() (string, error) {
		dao := fkratos_wechat_dao.Use(o.db).Officialaccount
		result, err := dao.WithContext(ctx).Where(dao.AppID.Eq(appID)).First()
		if err != nil && !errors.Is(err, gorm.ErrRecordNotFound) {
			return "", err
		}
		marshal, err := json.Marshal(result)
		if err != nil {
			return "", err
		}
		return string(marshal), nil
	})
	if err != nil {
		return nil, err
	}
	err = json.Unmarshal([]byte(cacheValue), resp)
	if err != nil {
		return nil, err
	}
	return resp, nil
}

