// FindMultiCacheByAppIDS 根据appIDS查询多条数据并设置缓存
func (o *OfficialaccountRepo) FindMultiCacheByAppIDS(ctx context.Context, appIDS []string) ([]*fkratos_wechat_model.Officialaccount, error) {
	resp := make([]*fkratos_wechat_model.Officialaccount, 0)
	cacheKeys := make([]string, 0)
	keyToParam := make(map[string]string)
	for _, v := range appIDS {
		cacheKey := o.cache.Key(cacheOfficialaccountByAppIDPrefix, v)
		cacheKeys = append(cacheKeys, cacheKey)
		keyToParam[cacheKey] = v
	}
	cacheValue, err := o.cache.FetchBatch(ctx, cacheKeys, func(miss []string) (map[string]string, error) {
		parameters := make([]string, 0)
		for _, v := range miss {
			parameters = append(parameters, keyToParam[v])
		}
		dao := fkratos_wechat_dao.Use(o.db).Officialaccount
		result, err := dao.WithContext(ctx).Where(dao.AppID.In(parameters...)).Find()
		if err != nil && !errors.Is(err, gorm.ErrRecordNotFound) {
			return nil, err
		}
		value := make(map[string]string)
		for _, v := range miss {
			value[v] = ""
		}
		for _, v := range result {
			marshal, err := json.Marshal(v)
			if err != nil {
				return nil, err
			}
			value[o.cache.Key(cacheOfficialaccountByAppIDPrefix, v.AppID)] = string(marshal)
		}
		return value, nil
	})
	if err != nil {
		return nil, err
	}
	for _, v := range cacheValue {
		tmp := new(fkratos_wechat_model.Officialaccount)
		err := json.Unmarshal([]byte(v), tmp)
		if err != nil {
			return nil, err
		}
		resp = append(resp, tmp)
	}
	return resp, nil
}

